@mixin mediaquery($breakpoint) {
    @if $breakpoint == xs {
        @media (min-width: 36em) {
        @content;
        }
    }

    @if $breakpoint == sm {
        @media (min-width: 48em) {
        @content;
        }
    }

    @else if $breakpoint == md {
        @media (min-width: 64em) {
        @content;
        }
    }

    @else if $breakpoint == lg {
        @media (min-width: 75em) {
        @content;
        }
    }

    @else {
        @content;
    }
}

