sources.../components/navigation/navigation.scss:
.c-navigation {
    border-right: 0.063rem solid #28293D;
	background: #0C0D14;
	overflow: hidden;
	position: sticky;
	left: 0;
	width: 60px;
	-webkit-transition: all 0.3s linear;
	transition: all 0.3s linear;
	-webkit-transform: translateZ(0) scale(1,1);
	transform: translateZ(0) scale(1,1);
	display: none;
	z-index: 9999;

	@include mediaquery(sm) {
		display: block;
	}

	&__item {
		&:focus {
			border: 1px solid white;
		}
	}

	&__content {
		display: flex;
		align-items: center;
		text-decoration: none;
	}

	&__name {
		color: #6842FF;
		white-space: nowrap;
		text-overflow: ellipsis;
		transition: 0.5s;
		transition-property: background;
		font-weight: 500;
	}

	&__icon {
		fill: #6842FF;
		width: 2rem;
		height: 2rem;
	}

	&__list {
		padding: 0;
	}

	&--mobile {
		position: fixed;
        width: 100%;
        bottom: 0;
        border-radius: 30% 30% 0 0;
        background: #1A1B28;

        z-index: 99;

		@include mediaquery(sm) {
			display: none;
		}

		&__list {
			list-style: none;
			display: flex;
			align-items: center;
			justify-content: space-evenly;
			padding: 0.5rem 0.75rem;
			margin: 0;
		}

		&__item {
			display: flex;
			align-items: center;
			padding: 8px;
		}

		&__content {
			display: flex;
			align-items: center;
			flex-direction: column;
			text-decoration: none;
		}

		&__name {
			color: #6842FF;
		}
	}
}

.c-navigation:hover, section.navigation.expanded {
	width: 14.375rem;
	overflow: hidden;
}

