sources.../components/carrousel/carrousel.scss:
.c-carrousel {
    display: flex;
    max-width: none !important;
    scroll-behavior: smooth;

    @include mediaquery(sm) {
        justify-content: center;
    }

    &__content {
        position: relative;
        overflow: hidden;
        padding: 0;
        margin: 0;
        max-width: 960px;

        @include mediaquery(lg) {
            max-width: 870px;
        }

        @include mediaquery(md) {
            max-width: 866px;
        }

        @include mediaquery(sm) {
            max-width: 1468px;
        }
    }

    &__align {
        display: flex;
        justify-content: center;
    }

    &--slider {
        display: flex;
        scroll-behavior: smooth;
        overflow: hidden;
    }

    &__card {
        position: relative;
        background: #2f303438;
        border-radius: 20px;
        padding: 24px;
        border: 1px solid hsl(245, 75%, 52%);
        box-shadow: 0px 4px 24px -1px rgba(0, 0, 0, 0.1);
        display: flex;
        flex-direction: column;
        align-items: center;

        ::before {
            content: "";
            position: absolute;
            top: 0;
            left: 0;
            height: 34%;
            width: 100%;
            background: hsl(245, 75%, 52%);
            border-radius: 20px 20px 0 0;
            z-index: -1;
        }

        &--button {
            border-radius: 10px;
            border: none;
            color: #fff;
            font-size: 20px;
            font-weight: 800;
            background: hsl(245, 75%, 52%);
            padding: 20px 70px;
            cursor: pointer;
        }

        &-content {
            color: #DEDEEA;
            text-align: center;
        }
    }

    &__card:first-child {
        margin-left: 0;
    }

    &__card:last-child {
        margin-right: 0;
    }

    &__image {
        width: 270px;
        height: 160px;
        object-fit: cover;
        border-radius: 30px;

        &-2 {
            width: 100%;
            height: 100%;
            padding: 3px;
            border-radius: 30px;
            background: hsl(245, 75%, 52%);
        }
    }

    &__arrow {
        position: absolute;
        scroll-behavior: smooth;
        cursor: pointer;
        top: calc(50% - 25px);
        z-index: 95;

        &-left {
            left: 0;
            transform: translateX(340px);
        }

        &-right {
            right: 0;
            transform: translateX(-340px);
            top: calc(50% - 25px);
        }
    }
}


