sources.../components/carousel/carousel.scss:
.c-carousel {
    flex-direction: column;
    margin: auto 0;

    @include mediaquery(sm) {
        flex-direction: unset;
        margin: 0;
    }

    display: flex;
    flex-direction: row;
    align-items: center;
    justify-content: center;
    position: relative;
    height: 21.875rem;
    width: 100%;

    &__card {
        transform: scale(1) translate(0px,0px) perspective( 750px ) rotateY(0deg);
        transition-timing-function: cubic-bezier(0.42, 0, 0.58, 1);
        transition-duration: 0.5s;
        position: absolute;
        top: 0;

        background: #1A1B28;
        border: 1px solid hsl(245, 75%, 52%);
        border-radius: 20px;
        box-shadow: 0 30px 50px rgba(0,0,0,0.1);

        display: flex;
        z-index: 3;
        cursor: pointer;
        overflow: hidden;
        width: 90%;
        height: auto;

        @include mediaquery(sm) {
            width: 25rem;
        }

        * {
            pointer-events: none;
        }

        ::before {
            content: "";
            position: absolute;
            top: 0;
            left: 0;
            height: 34%;
            width: 100%;
            background: hsl(245, 75%, 52%);
            border-radius: 20px 20px 0 0;
            z-index: -1;
        }

        &--left {
            transform: scale(0.75) translate(0px, -150px) perspective(750px) rotateY(0) rotateX(-10deg) translateZ(-5px);
            box-shadow: 0 15px 25px rgba(0,0,0,0.1);
            z-index: 1;

            @include mediaquery(sm) {
                transform: scale(0.75) translate(-335px,0px) perspective( 750px ) rotateY(10deg);
            }
        }

        &--center {
            transform: scale(1) translate(0px, 0px) perspective( 750px ) rotateY(0deg) rotateX(0deg) translateZ(5px);
            box-shadow: 0 30px 50px rgba(0,0,0,0.1);
            z-index: 3;

            @include mediaquery(sm) {
                transform: scale(1) translate(0px, 0px) perspective( 750px ) rotateY(0deg);
            }
        }

        &--right {
            transform: scale(0.75) translate(0px, 150px) perspective(750px) rotateY(0) rotateX(10deg) translateZ(-5px);
            box-shadow: 0 15px 25px rgba(0,0,0,0.1);
            z-index: 1;

            @include mediaquery(sm) {
                transform: scale(0.75) translate(335px,0px) perspective( 750px ) rotateY(-10deg);
            }
        }

        &--button {
            border-radius: 10px;
            border: none;
            color: #fff;
            font-size: 20px;
            font-weight: 800;
            background: hsl(245, 75%, 52%);
            padding: 18px 70px;
            cursor: pointer;
        }
    }

    &__detail {
        flex: 1;
        display: flex;
        align-items: center;
        flex-direction: column;
        justify-content: center;
    }

    &__image {
        width: 320px;
        height: 140px;
        object-fit: cover;
        border-radius: 16px;
    }
}


.button {
    position: absolute;

    &--left {
        left: 50%;
        top: 50%;
        transform: translateX(-200px);
    }

    &--right {
        right: 50%;
        top: 50%;
        transform: translateX(300px);
    }
}

.carousel {
    height: 50%;
    padding: 0;
    margin: 0;
    position: absolute;
    left: 50%;
    top: 50%;
    transform: translate3d(-50%, -40%, 0);
}

.item {
    width: 100px;
    height: 150px;
    background: #dadada;
    float: left;
    list-style: none;
    margin-right: 20px;
    position: absolute;
    top: 0;
    left: 0;
    -webkit-transform-style: preserve-3d;
    transition: all .5s ease;
}

.item--1 {
    background-color: pink;
}

.item--2 {
    background-color: purple;
}

.item--3 {
    background-color: orange;
    z-index: 3;
}

.item--4 {
    background-color: yellow;
}

.item--5 {
    background-color: green;
}

.item:last-child {
    margin-right: 0;
}

[data-position='1'] {
    transform: scale(1.5) translate3d(-65px, 0px, 0px);
    z-index: 1;
}

[data-position='2'] {
    transform: scale(1.75) translate3d(-30px, 0px, 0px);
    z-index: 2;
}

[data-position='3'] {
    transform: scale(2) translate3d(0px, 0px, 0px);
    z-index: 3;
}

[data-position='4'] {
    transform: scale(1.75) translate3d(30px, 0px, 0px);
    z-index: 2;
}

[data-position='5'] {
    transform: scale(1.5) translate3d(65px, 0px, -5px);
    z-index: 1;
}

@keyframes crossfade {
    0% {
        opacity: 1;
    }
    5% {
        opacity: 0.7;
    }
    10% {
        opacity: 1;
    }
    100% {
        opacity: 1;
    }
}

.c-carousel-v2 {
    width: 100%;
    height: 100%;
    background: #efefef;
    position: absolute;

    &__list {
        height: 50%;
        padding: 0;
        margin: 0;
        position: absolute;
        left: 50%;
        top: 50%;
        transform: translate3d(-50%, -40%, 0);
    }
}
